from PIL import Image
from io import BytesIO
import base64

def get_base_64_string(path):
    with open(path, 'rb') as file:
        return base64.b64encode(file.read()).decode('utf-8')
#using base 64 string storage to easily store images in the file
logo_string = ''
icon_string = ''
#decode logo
image_data = base64.b64decode(logo_string)
logo_data = BytesIO(image_data)
#open image with pillow
logo_image = Image.open(logo_data)
logo_width, logo_height = logo_image.size
#conversion to tk image deosn't like floats
logo_image = logo_image.resize((int(logo_width / 1.2), int(logo_height / 1.2)), Image.LANCZOS)
#decode icon
image_data = base64.b64decode(icon_string)
icon_data = BytesIO(image_data)
#open image with pillow
